static const char __pyx_k_Creates_an_index_on_this_collect[] = "Creates an index on this collection.\n\n        Takes either a single key or a list containing (key, direction) pairs\n        or keys.  If no direction is given, :data:`~pymongo.ASCENDING` will\n        be assumed.\n        The key(s) must be an instance of :class:`basestring`\n        (:class:`str` in python 3), and the direction(s) must be one of\n        (:data:`~pymongo.ASCENDING`, :data:`~pymongo.DESCENDING`,\n        :data:`~pymongo.GEO2D`, :data:`~pymongo.GEOSPHERE`,\n        :data:`~pymongo.HASHED`, :data:`~pymongo.TEXT`).\n\n        To create a single key ascending index on the key ``'mike'`` we just\n        use a string argument::\n\n          >>> my_collection.create_index(\"mike\")\n\n        For a compound index on ``'mike'`` descending and ``'eliot'``\n        ascending we need to use a list of tuples::\n\n          >>> my_collection.create_index([(\"mike\", pymongo.DESCENDING),\n          ...                             \"eliot\"])\n\n        All optional index creation parameters should be passed as\n        keyword arguments to this method. For example::\n\n          >>> my_collection.create_index([(\"mike\", pymongo.DESCENDING)],\n          ...                            background=True)\n\n        Valid options include, but are not limited to:\n\n          - `name`: custom name to use for this index - if none is\n            given, a name will be generated.\n          - `unique`: if ``True``, creates a uniqueness constraint on the\n            index.\n          - `background`: if ``True``, this index should be created in the\n            background.\n          - `sparse`: if ``True``, omit from the index any documents that lack\n            the indexed field.\n          - `bucketSize`: for use with geoHaystack indexes.\n            Number of documents to group together within a certain proximity\n            to a given longitude and latitude.\n          - `min`: minimum value for keys in a :data:`~pymongo.GEO2D`\n            index.\n          - ""`max`: maximum value for keys in a :data:`~pymongo.GEO2D`\n            index.\n          - `expireAfterSeconds`: <int> Used to create an expiring (TTL)\n            collection. MongoDB will automatically delete documents from\n            this collection after <int> seconds. The indexed field must\n            be a UTC datetime or the data will not expire.\n          - `partialFilterExpression`: A document that specifies a filter for\n            a partial index.\n          - `collation` (optional): An instance of\n            :class:`~pymongo.collation.Collation`.\n          - `wildcardProjection`: Allows users to include or exclude specific\n            field paths from a `wildcard index`_ using the {\"$**\" : 1} key\n            pattern. Requires MongoDB >= 4.2.\n          - `hidden`: if ``True``, this index will be hidden from the query\n            planner and will not be evaluated as part of query plan\n            selection. Requires MongoDB >= 4.4.\n\n        See the MongoDB documentation for a full list of supported options by\n        server version.\n\n        .. warning:: `dropDups` is not supported by MongoDB 3.0 or newer. The\n          option is silently ignored by the server and unique index builds\n          using the option will fail if a duplicate value is detected.\n\n        .. note:: The :attr:`~pymongo.collection.Collection.write_concern` of\n           this collection is automatically applied to this operation.\n\n        :Parameters:\n          - `keys`: a single key or a list of (key, direction)\n            pairs specifying the index to create\n          - `session` (optional): a\n            :class:`~pymongo.client_session.ClientSession`.\n          - `comment` (optional): A user-provided comment to attach to this\n            command.\n          - `**kwargs` (optional): any additional index creation\n            options (see the above list) should be passed as keyword\n            arguments.\n\n        .. versionchanged:: 4.4\n          "" Allow passing a list containing (key, direction) pairs\n           or keys for the ``keys`` parameter.\n        .. versionchanged:: 4.1\n           Added ``comment`` parameter.\n        .. versionchanged:: 3.11\n           Added the ``hidden`` option.\n        .. versionchanged:: 3.6\n           Added ``session`` parameter. Added support for passing maxTimeMS\n           in kwargs.\n        .. versionchanged:: 3.4\n           Apply this collection's write concern automatically to this operation\n           when connected to MongoDB >= 3.4. Support the `collation` option.\n        .. versionchanged:: 3.2\n           Added partialFilterExpression to support partial indexes.\n        .. versionchanged:: 3.0\n           Renamed `key_or_list` to `keys`. Removed the `cache_for` option.\n           :meth:`create_index` no longer caches index names. Removed support\n           for the drop_dups and bucket_size aliases.\n\n        .. seealso:: The MongoDB documentation on `indexes <https://dochub.mongodb.org/core/indexes>`_.\n\n        .. _wildcard index: https://dochub.mongodb.org/core/index-wildcard/\n        ";
static const char __pyx_k_Delete_a_single_document_matchin[] = "Delete a single document matching the filter.\n\n          >>> db.test.count_documents({'x': 1})\n          3\n          >>> result = db.test.delete_one({'x': 1})\n          >>> result.deleted_count\n          1\n          >>> db.test.count_documents({'x': 1})\n          2\n\n        :Parameters:\n          - `filter`: A query that matches the document to delete.\n          - `collation` (optional): An instance of\n            :class:`~pymongo.collation.Collation`.\n          - `hint` (optional): An index to use to support the query\n            predicate specified either by its string name, or in the same\n            format as passed to\n            :meth:`~pymongo.collection.Collection.create_index` (e.g.\n            ``[('field', ASCENDING)]``). This option is only supported on\n            MongoDB 4.4 and above.\n          - `session` (optional): a\n            :class:`~pymongo.client_session.ClientSession`.\n          - `let` (optional): Map of parameter names and values. Values must be\n            constant or closed expressions that do not reference document\n            fields. Parameters can then be accessed as variables in an\n            aggregate expression context (e.g. \"$$var\").\n          - `comment` (optional): A user-provided comment to attach to this\n            command.\n\n        :Returns:\n          - An instance of :class:`~pymongo.results.DeleteResult`.\n\n        .. versionchanged:: 4.1\n           Added ``let`` parameter.\n           Added ``comment`` parameter.\n        .. versionchanged:: 3.11\n           Added ``hint`` parameter.\n        .. versionchanged:: 3.6\n           Added ``session`` parameter.\n        .. versionchanged:: 3.4\n          Added the `collation` option.\n        .. versionadded:: 3.0\n        ";
static const char __pyx_k_Delete_one_or_more_documents_mat[] = "Delete one or more documents matching the filter.\n\n          >>> db.test.count_documents({'x': 1})\n          3\n          >>> result = db.test.delete_many({'x': 1})\n          >>> result.deleted_count\n          3\n          >>> db.test.count_documents({'x': 1})\n          0\n\n        :Parameters:\n          - `filter`: A query that matches the documents to delete.\n          - `collation` (optional): An instance of\n            :class:`~pymongo.collation.Collation`.\n          - `hint` (optional): An index to use to support the query\n            predicate specified either by its string name, or in the same\n            format as passed to\n            :meth:`~pymongo.collection.Collection.create_index` (e.g.\n            ``[('field', ASCENDING)]``). This option is only supported on\n            MongoDB 4.4 and above.\n          - `session` (optional): a\n            :class:`~pymongo.client_session.ClientSession`.\n          - `let` (optional): Map of parameter names and values. Values must be\n            constant or closed expressions that do not reference document\n            fields. Parameters can then be accessed as variables in an\n            aggregate expression context (e.g. \"$$var\").\n          - `comment` (optional): A user-provided comment to attach to this\n            command.\n\n        :Returns:\n          - An instance of :class:`~pymongo.results.DeleteResult`.\n\n        .. versionchanged:: 4.1\n           Added ``let`` parameter.\n           Added ``comment`` parameter.\n        .. versionchanged:: 3.11\n           Added ``hint`` parameter.\n        .. versionchanged:: 3.6\n           Added ``session`` parameter.\n        .. versionchanged:: 3.4\n          Added the `collation` option.\n        .. versionadded:: 3.0\n        ";
