static const char __pyx_k_Finds_a_single_document_and_dele[] = "Finds a single document and deletes it, returning the document.\n\n          >>> db.test.count_documents({'x': 1})\n          2\n          >>> db.test.find_one_and_delete({'x': 1})\n          {'x': 1, '_id': ObjectId('54f4e12bfba5220aa4d6dee8')}\n          >>> db.test.count_documents({'x': 1})\n          1\n\n        If multiple documents match *filter*, a *sort* can be applied.\n\n          >>> for doc in db.test.find({'x': 1}):\n          ...     print(doc)\n          ...\n          {'x': 1, '_id': 0}\n          {'x': 1, '_id': 1}\n          {'x': 1, '_id': 2}\n          >>> db.test.find_one_and_delete(\n          ...     {'x': 1}, sort=[('_id', pymongo.DESCENDING)])\n          {'x': 1, '_id': 2}\n\n        The *projection* option can be used to limit the fields returned.\n\n          >>> db.test.find_one_and_delete({'x': 1}, projection={'_id': False})\n          {'x': 1}\n\n        :Parameters:\n          - `filter`: A query that matches the document to delete.\n          - `projection` (optional): a list of field names that should be\n            returned in the result document or a mapping specifying the fields\n            to include or exclude. If `projection` is a list \"_id\" will\n            always be returned. Use a mapping to exclude fields from\n            the result (e.g. projection={'_id': False}).\n          - `sort` (optional): a list of (key, direction) pairs\n            specifying the sort order for the query. If multiple documents\n            match the query, they are sorted and the first is deleted.\n          - `hint` (optional): An index to use to support the query predicate\n            specified either by its string name, or in the same format as\n            passed to :meth:`~pymongo.collection.Collection.create_index`\n            (e.g. ``[('field', ASCENDING)]``). This option is only supported\n            on MongoDB 4.4 and above.\n          - `session` (optional): a\n            :class:`~pymongo.client_session.ClientSession`.\n     ""     - `let` (optional): Map of parameter names and values. Values must be\n            constant or closed expressions that do not reference document\n            fields. Parameters can then be accessed as variables in an\n            aggregate expression context (e.g. \"$$var\").\n          - `comment` (optional): A user-provided comment to attach to this\n            command.\n          - `**kwargs` (optional): additional command arguments can be passed\n            as keyword arguments (for example maxTimeMS can be used with\n            recent server versions).\n\n        .. versionchanged:: 4.1\n           Added ``let`` parameter.\n        .. versionchanged:: 3.11\n           Added ``hint`` parameter.\n        .. versionchanged:: 3.6\n           Added ``session`` parameter.\n        .. versionchanged:: 3.2\n           Respects write concern.\n\n        .. warning:: Starting in PyMongo 3.2, this command uses the\n           :class:`~pymongo.write_concern.WriteConcern` of this\n           :class:`~pymongo.collection.Collection` when connected to MongoDB >=\n           3.2. Note that using an elevated write concern with this command may\n           be slower compared to using the default write concern.\n\n        .. versionchanged:: 3.4\n           Added the `collation` option.\n        .. versionadded:: 3.0\n        ";
static const char __pyx_k_Finds_a_single_document_and_repl[] = "Finds a single document and replaces it, returning either the\n        original or the replaced document.\n\n        The :meth:`find_one_and_replace` method differs from\n        :meth:`find_one_and_update` by replacing the document matched by\n        *filter*, rather than modifying the existing document.\n\n          >>> for doc in db.test.find({}):\n          ...     print(doc)\n          ...\n          {'x': 1, '_id': 0}\n          {'x': 1, '_id': 1}\n          {'x': 1, '_id': 2}\n          >>> db.test.find_one_and_replace({'x': 1}, {'y': 1})\n          {'x': 1, '_id': 0}\n          >>> for doc in db.test.find({}):\n          ...     print(doc)\n          ...\n          {'y': 1, '_id': 0}\n          {'x': 1, '_id': 1}\n          {'x': 1, '_id': 2}\n\n        :Parameters:\n          - `filter`: A query that matches the document to replace.\n          - `replacement`: The replacement document.\n          - `projection` (optional): A list of field names that should be\n            returned in the result document or a mapping specifying the fields\n            to include or exclude. If `projection` is a list \"_id\" will\n            always be returned. Use a mapping to exclude fields from\n            the result (e.g. projection={'_id': False}).\n          - `sort` (optional): a list of (key, direction) pairs\n            specifying the sort order for the query. If multiple documents\n            match the query, they are sorted and the first is replaced.\n          - `upsert` (optional): When ``True``, inserts a new document if no\n            document matches the query. Defaults to ``False``.\n          - `return_document`: If\n            :attr:`ReturnDocument.BEFORE` (the default),\n            returns the original document before it was replaced, or ``None``\n            if no document matches. If\n            :attr:`ReturnDocument.AFTER`, returns the replaced\n            or inserted document.\n          - `hint` (optional): An index to use to support the que""ry\n            predicate specified either by its string name, or in the same\n            format as passed to\n            :meth:`~pymongo.collection.Collection.create_index` (e.g.\n            ``[('field', ASCENDING)]``). This option is only supported on\n            MongoDB 4.4 and above.\n          - `session` (optional): a\n            :class:`~pymongo.client_session.ClientSession`.\n          - `let` (optional): Map of parameter names and values. Values must be\n            constant or closed expressions that do not reference document\n            fields. Parameters can then be accessed as variables in an\n            aggregate expression context (e.g. \"$$var\").\n          - `comment` (optional): A user-provided comment to attach to this\n            command.\n          - `**kwargs` (optional): additional command arguments can be passed\n            as keyword arguments (for example maxTimeMS can be used with\n            recent server versions).\n\n        .. versionchanged:: 4.1\n           Added ``let`` parameter.\n        .. versionchanged:: 3.11\n           Added the ``hint`` option.\n        .. versionchanged:: 3.6\n           Added ``session`` parameter.\n        .. versionchanged:: 3.4\n           Added the ``collation`` option.\n        .. versionchanged:: 3.2\n           Respects write concern.\n\n        .. warning:: Starting in PyMongo 3.2, this command uses the\n           :class:`~pymongo.write_concern.WriteConcern` of this\n           :class:`~pymongo.collection.Collection` when connected to MongoDB >=\n           3.2. Note that using an elevated write concern with this command may\n           be slower compared to using the default write concern.\n\n        .. versionadded:: 3.0\n        ";
static const char __pyx_k_Finds_a_single_document_and_upda[] = "Finds a single document and updates it, returning either the\n        original or the updated document.\n\n          >>> db.test.find_one_and_update(\n          ...    {'_id': 665}, {'$inc': {'count': 1}, '$set': {'done': True}})\n          {'_id': 665, 'done': False, 'count': 25}}\n\n        Returns ``None`` if no document matches the filter.\n\n          >>> db.test.find_one_and_update(\n          ...    {'_exists': False}, {'$inc': {'count': 1}})\n\n        When the filter matches, by default :meth:`find_one_and_update`\n        returns the original version of the document before the update was\n        applied. To return the updated (or inserted in the case of\n        *upsert*) version of the document instead, use the *return_document*\n        option.\n\n          >>> from pymongo import ReturnDocument\n          >>> db.example.find_one_and_update(\n          ...     {'_id': 'userid'},\n          ...     {'$inc': {'seq': 1}},\n          ...     return_document=ReturnDocument.AFTER)\n          {'_id': 'userid', 'seq': 1}\n\n        You can limit the fields returned with the *projection* option.\n\n          >>> db.example.find_one_and_update(\n          ...     {'_id': 'userid'},\n          ...     {'$inc': {'seq': 1}},\n          ...     projection={'seq': True, '_id': False},\n          ...     return_document=ReturnDocument.AFTER)\n          {'seq': 2}\n\n        The *upsert* option can be used to create the document if it doesn't\n        already exist.\n\n          >>> db.example.delete_many({}).deleted_count\n          1\n          >>> db.example.find_one_and_update(\n          ...     {'_id': 'userid'},\n          ...     {'$inc': {'seq': 1}},\n          ...     projection={'seq': True, '_id': False},\n          ...     upsert=True,\n          ...     return_document=ReturnDocument.AFTER)\n          {'seq': 1}\n\n        If multiple documents match *filter*, a *sort* can be applied.\n\n          >>> for doc in db.test.find({'done': True}):\n          ...""     print(doc)\n          ...\n          {'_id': 665, 'done': True, 'result': {'count': 26}}\n          {'_id': 701, 'done': True, 'result': {'count': 17}}\n          >>> db.test.find_one_and_update(\n          ...     {'done': True},\n          ...     {'$set': {'final': True}},\n          ...     sort=[('_id', pymongo.DESCENDING)])\n          {'_id': 701, 'done': True, 'result': {'count': 17}}\n\n        :Parameters:\n          - `filter`: A query that matches the document to update.\n          - `update`: The update operations to apply.\n          - `projection` (optional): A list of field names that should be\n            returned in the result document or a mapping specifying the fields\n            to include or exclude. If `projection` is a list \"_id\" will\n            always be returned. Use a dict to exclude fields from\n            the result (e.g. projection={'_id': False}).\n          - `sort` (optional): a list of (key, direction) pairs\n            specifying the sort order for the query. If multiple documents\n            match the query, they are sorted and the first is updated.\n          - `upsert` (optional): When ``True``, inserts a new document if no\n            document matches the query. Defaults to ``False``.\n          - `return_document`: If\n            :attr:`ReturnDocument.BEFORE` (the default),\n            returns the original document before it was updated. If\n            :attr:`ReturnDocument.AFTER`, returns the updated\n            or inserted document.\n          - `array_filters` (optional): A list of filters specifying which\n            array elements an update should apply.\n          - `hint` (optional): An index to use to support the query\n            predicate specified either by its string name, or in the same\n            format as passed to\n            :meth:`~pymongo.collection.Collection.create_index` (e.g.\n            ``[('field', ASCENDING)]``). This option is only supported on\n            MongoDB 4.4 and abo""ve.\n          - `session` (optional): a\n            :class:`~pymongo.client_session.ClientSession`.\n          - `let` (optional): Map of parameter names and values. Values must be\n            constant or closed expressions that do not reference document\n            fields. Parameters can then be accessed as variables in an\n            aggregate expression context (e.g. \"$$var\").\n          - `comment` (optional): A user-provided comment to attach to this\n            command.\n          - `**kwargs` (optional): additional command arguments can be passed\n            as keyword arguments (for example maxTimeMS can be used with\n            recent server versions).\n\n        .. versionchanged:: 3.11\n           Added the ``hint`` option.\n        .. versionchanged:: 3.9\n           Added the ability to accept a pipeline as the ``update``.\n        .. versionchanged:: 3.6\n           Added the ``array_filters`` and ``session`` options.\n        .. versionchanged:: 3.4\n           Added the ``collation`` option.\n        .. versionchanged:: 3.2\n           Respects write concern.\n\n        .. warning:: Starting in PyMongo 3.2, this command uses the\n           :class:`~pymongo.write_concern.WriteConcern` of this\n           :class:`~pymongo.collection.Collection` when connected to MongoDB >=\n           3.2. Note that using an elevated write concern with this command may\n           be slower compared to using the default write concern.\n\n        .. versionadded:: 3.0\n        ";
static const char __pyx_k_Get_a_clone_of_this_collection_c[] = "Get a clone of this collection changing the specified settings.\n\n          >>> coll1.read_preference\n          Primary()\n          >>> from pymongo import ReadPreference\n          >>> coll2 = coll1.with_options(read_preference=ReadPreference.SECONDARY)\n          >>> coll1.read_preference\n          Primary()\n          >>> coll2.read_preference\n          Secondary(tag_sets=None)\n\n        :Parameters:\n          - `codec_options` (optional): An instance of\n            :class:`~bson.codec_options.CodecOptions`. If ``None`` (the\n            default) the :attr:`codec_options` of this :class:`Collection`\n            is used.\n          - `read_preference` (optional): The read preference to use. If\n            ``None`` (the default) the :attr:`read_preference` of this\n            :class:`Collection` is used. See :mod:`~pymongo.read_preferences`\n            for options.\n          - `write_concern` (optional): An instance of\n            :class:`~pymongo.write_concern.WriteConcern`. If ``None`` (the\n            default) the :attr:`write_concern` of this :class:`Collection`\n            is used.\n          - `read_concern` (optional): An instance of\n            :class:`~pymongo.read_concern.ReadConcern`. If ``None`` (the\n            default) the :attr:`read_concern` of this :class:`Collection`\n            is used.\n        ";
static const char __pyx_k_Get_a_cursor_over_the_index_docu[] = "Get a cursor over the index documents for this collection.\n\n          >>> for index in db.test.list_indexes():\n          ...     print(index)\n          ...\n          SON([('v', 2), ('key', SON([('_id', 1)])), ('name', '_id_')])\n\n        :Parameters:\n          - `session` (optional): a\n            :class:`~pymongo.client_session.ClientSession`.\n          - `comment` (optional): A user-provided comment to attach to this\n            command.\n\n        :Returns:\n          An instance of :class:`~pymongo.command_cursor.CommandCursor`.\n\n        .. versionchanged:: 4.1\n           Added ``comment`` parameter.\n\n        .. versionchanged:: 3.6\n           Added ``session`` parameter.\n\n        .. versionadded:: 3.0\n        ";
static const char __pyx_k_Get_a_single_document_from_the_d[] = "Get a single document from the database.\n\n        All arguments to :meth:`find` are also valid arguments for\n        :meth:`find_one`, although any `limit` argument will be\n        ignored. Returns a single document, or ``None`` if no matching\n        document is found.\n\n        The :meth:`find_one` method obeys the :attr:`read_preference` of\n        this :class:`Collection`.\n\n        :Parameters:\n\n          - `filter` (optional): a dictionary specifying\n            the query to be performed OR any other type to be used as\n            the value for a query for ``\"_id\"``.\n\n          - `*args` (optional): any additional positional arguments\n            are the same as the arguments to :meth:`find`.\n\n          - `**kwargs` (optional): any additional keyword arguments\n            are the same as the arguments to :meth:`find`.\n\n              >>> collection.find_one(max_time_ms=100)\n\n        ";
static const char __pyx_k_Get_information_on_this_collecti[] = "Get information on this collection's indexes.\n\n        Returns a dictionary where the keys are index names (as\n        returned by create_index()) and the values are dictionaries\n        containing information about each index. The dictionary is\n        guaranteed to contain at least a single key, ``\"key\"`` which\n        is a list of (key, direction) pairs specifying the index (as\n        passed to create_index()). It will also contain any other\n        metadata about the indexes, except for the ``\"ns\"`` and\n        ``\"name\"`` keys, which are cleaned. Example output might look\n        like this:\n\n        >>> db.test.create_index(\"x\", unique=True)\n        'x_1'\n        >>> db.test.index_information()\n        {'_id_': {'key': [('_id', 1)]},\n         'x_1': {'unique': True, 'key': [('x', 1)]}}\n\n        :Parameters:\n          - `session` (optional): a\n            :class:`~pymongo.client_session.ClientSession`.\n          - `comment` (optional): A user-provided comment to attach to this\n            command.\n\n        .. versionchanged:: 4.1\n           Added ``comment`` parameter.\n\n        .. versionchanged:: 3.6\n           Added ``session`` parameter.\n        ";
